    "This app brings a user interface to use the Nextcloud text processing feature.\n\nIt allows users to launch AI tasks, be notified when they finish and see the results.\nThe assistant also appears in others apps like Text to easily process parts of a document.\n\nMore details on the assistant OCS API and frontend integration possibilities in the\n[developer doc](https://github.com/nextcloud/assistant/raw/main/docs/developer)\n\n### How to use it\n\nA new right header menu entry appears. Once clicked, the assistant is displayed and you can select and task type and\nset the input you want to process.\n\nThe task might run immediately or be scheduled depending on the time estimation given by the AI provider.\nOnce a task is scheduled, it will run as a background job. When it is finished, you will receive a notification\nfrom which the results can be displayed.\n\nOther apps can integrate with the assistant. For example, Text will display an inline button besides every paragraph\nto directly select a task type to process this paragraph. Selecting a task this way will open the assistant with the task\nbeing pre-selected and the input text set.\n\nMore details and screenshots in the [user doc](https://github.com/nextcloud/assistant/raw/main/docs/user).\n\n## Features\n\nIn the assistant, the list of available tasks depends on the available providers installed via other apps.\nThis means you have complete freedom over which service/software will actually run your AI tasks.\n\n### Text processing providers\n\nSo far, the [Local Large language model](https://github.com/nextcloud/llm2#readme)\nand the [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai) apps\ninclude text processing providers to:\n* Summarize\n* Extract topics\n* Generate a headline\n* Get an answer from a free prompt\n* Reformulate (OpenAi/LocalAi only)\n* Context writer: Generate text with a specified style. The style can be described or provided via an example text.\n\n### Text to image (Image generation)\n\nKnown providers:\n* [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai)\n* [Text2Image Stable Diffusion](https://apps.nextcloud.com/apps/text2image_stablediffusion)\n\n### Speech to text (Audio transcription)\n\nKnown providers:\n* [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai)\n* [Local Whisper Speech-To-Text](https://apps.nextcloud.com/apps/stt_whisper)\n\nMore details on how to set this up in the [admin docs](https://docs.nextcloud.com/server/latest/admin_manual/ai/index.html)" : "See rakendus tagab kasutajaliidese, et kasutada Nextcloudi tekstitöötluse funktsiooni.\n\nSee võimaldab kasutajatel käivitada tehisaru-põhiseid ülesandeid, saada teateid, kui need on lõpetatud, ja vaadata tulemusi. Abiline ilmub ka teistes rakendustes, nagu Tekstirakendus, et hõlpsasti töödelda dokumendi osi.\n\nTäiendavad üksikasjad Abilise OCS API ja kasutajaliidese lõimimisvõimaluste kohta leiad\n[arendaja dokumentatsioonist](https://github.com/nextcloud/assistant/raw/main/docs/developer)\n\n### Kuidas seda kasutada\n\nParemale tekib uus menüüelement. Kui sellele klõpsata, kuvatakse Abiline ja saad valida ülesande tüübi ning määrata sisendi, mida soovid töödelda.\n\nÜlesanne võib käivituda kohe või olla ajastatud, sõltuvalt ajahinnangust, mille on andnud AI teenusepakkuja. Kui ülesanne on ajastatud, käivitatakse ta taustatöötlusena. Kui see on lõpetatud, saadetakse sulle teavitus, mille abil saad tulemusi vaadata.\n\nTeised rakendused saavad lõimuda Abilisega. Näiteks tekstirakendus kuvab iga lõigu kõrval sisseehitatud nuppu, et valida otse ülesande tüüp, millega seda lõiku töödelda. Sellisel viisil ülesande valimine avab Abilise, kus ülesanne on eelnevalt valitud ja sisendtekst määratud.\n\nTäiendavad üksikasjad ja ekraanipildid leiad [kasutaja dokumentatsioonist](https://github.com/nextcloud/assistant/raw/main/docs/user).\n\n## Funktsioonid\n\nAbilises saadaval olevate ülesannete nimekiri sõltub nendega ühendatud teenusepakkujatest, mis on paigaldatud teiste rakenduste kaudu. See tähendab, et sul on täielik vabadus valida, milline teenus/programm tegelikult sinu tehisarupõhiseid ülesandeid täidab.\n\n### Tekstitöötluse teenusepakkujad\n\nSiiani sisaldavad [kohalik suur keelmudel](https://github.com/nextcloud/llm2#readme)\nja [OpenAI/LocalAI lõiming](https://apps.nextcloud.com/apps/integration_openai) rakendused tekstitöötluse teenusepakkujaid, et:\n\n* koostada kokkuvõtteid\n* tuvastada teemasid\n* koostada pealkirju\n* saada vastuseid vabalt sõnastatud küsimustele\n* sõnastust muuta (ainult OpenAi/LocalAi)\n* kasutada kontekstuaalset kirjutajat, mis koostab etteantud stiilis; stiili saad kirjeldada või esitada näidisteksti abil\n\n### Tekst pildiks (Pildiloome)\n\nTeadaolevad teenusepakkujad:\n* [OpenAI/LocalAI lõiming](https://apps.nextcloud.com/apps/integration_openai)\n* [Text2Image Stable Diffusion](https://apps.nextcloud.com/apps/text2image_stablediffusion)\n\n### Kõne tekstiks (heli üleskirjutus)\n\nTeadaolevad teenusepakkujad:\n* [OpenAI/LocalAI lõiming](https://apps.nextcloud.com/apps/integration_openai)\n* [Kohalik Whisperipõhine Speech-To-Text](https://apps.nextcloud.com/apps/stt_whisper)\n\nTäiendavaid üksikasju selle kõige seadistamise kohta leiad [peakasutaja dokumentatsioonist](https://docs.nextcloud.com/server/latest/admin_manual/ai/index.html)",
